import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginregisterComponent } from './events/components/loginregister/loginregister.component';
import { FooterComponent } from './shared/footer/footer.component';

const routes: Routes = [
 
    { path: '', component: LoginregisterComponent }, // Esto establece HomeComponent como el componente predeterminado cuando se carga la aplicación.
    { path: '', component: FooterComponent },
  ];


@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
